import React from "react";
import HeaderCarousel from "../../components/headerCarousel/HeaderCarousel";
import Card from "../../components/card/Card";
import HeaderSearch from "../../components/headerSearch/HeaderSearch";

const Home = () => {
  return (
    <>
      <HeaderCarousel />
      <Card />
      <HeaderSearch />
    </>
  );
};

export default Home;
